### Summary of Core Topics, Concepts, Principles, and Equations

#### 1. Linear Algebra
- **Matrix Operations**: Understanding matrix multiplication, inversion, and diagonalization.
  - **Diagonalization**: \( P^{-1}AP = D \), where \( D \) is a diagonal matrix.
- **Vector Spaces**: Row space and column space of a matrix.
  - **Row Space**: Span of the row vectors of a matrix.
  - **Column Space**: Span of the column vectors of a matrix.
- **Eigenvalues and Eigenvectors**: Understanding how to find eigenvalues and eigenvectors of a matrix.
  - **Eigenvalue Equation**: \( Av = \lambda v \), where \( A \) is a matrix, \( v \) is an eigenvector, and \( \lambda \) is an eigenvalue.
- **Symmetric Matrices**: Properties of symmetric matrices and their diagonalization.
  - **Symmetric Matrix**: \( A = A^T \).
  - **Orthogonal Diagonalization**: \( A = PDP^T \), where \( P \) is orthogonal and \( D \) is diagonal.

#### 2. Calculus
- **Linear Approximation**: Using the tangent line to approximate the value of a function near a point.
  - **Linear Approximation Formula**: \( f(x) \approx f(a) + f'(a)(x - a) \).
- **Multivariable Calculus**: Partial derivatives and directional derivatives.
  - **Partial Derivatives**: \( \frac{\partial f}{\partial x} \) and \( \frac{\partial f}{\partial y} \).
  - **Directional Derivative**: \( D_{\mathbf{u}} f(a, b) = \nabla f(a, b) \cdot \mathbf{u} \).
- **Limits and Continuity**: Understanding the behavior of functions as they approach certain points.
  - **Limit Definition**: \( \lim_{x \to a} f(x) = L \).
  - **Continuity**: A function \( f \) is continuous at \( a \) if \( \lim_{x \to a} f(x) = f(a) \).

#### 3. Machine Learning
- **Supervised Learning**: Tasks where the model is trained on labeled data.
  - **Examples**: Predicting sales, recognizing handwritten characters, categorizing text documents.
- **Dimensionality Reduction**: Techniques to reduce the number of features in a dataset.
  - **Encoder-Decoder Pair**: Functions to reduce and reconstruct data dimensions.
  - **Reconstruction Error**: \( R(f, g) = \frac{1}{n} \sum_{i=1}^{n} \| X_i - g(f(X_i)) \|^2 \).

#### 4. Least Squares Method
- **Best Fit Line**: Finding the line that minimizes the sum of the squared differences between the observed and predicted values.
  - **Least Squares Formula**: \( y = mx + b \), where \( m \) and \( b \) are chosen to minimize the sum of squared errors.

